import './App.css';
import Header from './components/Header';
import Homepage from './components/Homepage';
import Footer from './components/Footer';
import { BrowserRouter as Router, Route } from 'react-router-dom';
function App() {
  return (

      <>
     <Router>
      <Routes></Routes>
      <Route path='/'>
      <Header/>
      <Homepage/>
      <Footer/>
      </Route>
      </Router>

    </>
  );
}

export default App;
